import React from "react";
import { BrowserRouter, Route, Routes, Navigate } from "react-router-dom";
import AdminDashboard from "./AdminDashboard";
import StudentPortal from "./StudentPortal";
import CertificateTemplate from "./CertificateTemplate";
import CertificateGenerator from './CertificateGenerator';

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        {/* Redirect from root to admin dashboard */}
        <Route path="/" element={<Navigate to="/admin" />} />

        {/* Admin Dashboard route */}
        <Route path="/admin" element={<AdminDashboard />} />

        {/* Student Portal route */}
        <Route path="/student" element={<StudentPortal />} />

        {/* Certificate Template route with dynamic ID */}
        <Route path="/certificate/:id" element={<CertificateTemplate />} />

        {/* Certificate Generator route */}
        <Route path="/certificate-generator" element={<CertificateGenerator />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
